cordova.define("com.jiedaibao.hybridnavigation.HybridNavigation", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       hybridNavigation : function(hybridNavigation, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'HybridNavigation',
            'hybridNavigation',
            [{
             "hybridNavigation": hybridNavigation
             }]
            );
       }
    }
  }
);
